import React from "react";

const Navigation = () => {
  return (
    <nav style={{ display: "flex", justifyContent: "flex-end" }}>
      <p
        style={{ background: "black", color: "white", padding: "5px 8px" }}
        className=""
      >
        Sign Out
      </p>
    </nav>
  );
};

export default Navigation;
